script: |
  super -f text -I q11363.spq | sort > q11363.out

inputs:
  - name: q11363.spq
    data: |
      SELECT ALL + + col1 / - col1 + + ( cor0.col2 + - col2 ) * cor0.col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q11363.out
    data: |
      -1
      -1
      -1
